namespace JoinRpg.Integrations.KogdaIgra.Test;

public class UpdatesMarkerParserTest
{
    [Fact]
    public void TestSimple()
    {
        var str = """
[
{"id":11226,"update_date":"2023-07-27T22:23:45.208331+03:00"},
{"id":11225,"update_date":"2023-07-26T22:35:41.565002+03"},
{"id":11224,"update_date":"2023-07-26T21:55:00.351918+03"}
]
""";
        var x = ResultParser.ParseGameUpdateMarkers(str);
        x.Length.ShouldBe(3);
        x[0].Id.ShouldBe(11226);
        x[0].UpdateDate.ShouldBe(new DateTimeOffset(2023, 07, 27, 22, 23, 45, TimeSpan.FromHours(3)), TimeSpan.FromSeconds(1));
    }

